import { useState } from "react";

const Home = () => {
  const [name, setName] = useState("Gabriel");
  const [age, setAge] = useState("24");
  const [test, setTest] = useState("testing the use-state thing before click");

  const handleClick = () => {
    setName("Gica");
    setAge(29);
  };

  return (
    <div className="home">
      <h2>Homepage</h2>

      <button onClick={handleClick} className="home-button">
        Click me
      </button>
      <p>
        {" "}
        {name} is {age} years old. Also, this is {test}
      </p>
    </div>
  );
};

export default Home;
